"""**Task_2: Rename State/UT Names**"""

def transform_state_name(name):
    words = name.lower().split()
    transformed_words = [word.capitalize() if word != 'and' else word for word in words]
    return ' '.join(transformed_words)
df_census['State/UT'] = df_census['State/UT'].apply(transform_state_name)

df_census.head()

