# Define your PostgreSQL table name
table_name = "cenus_data"
pg_conn = psycopg2.connect(
    dbname="postgres",
    user="postgres",
    password="jaisriram",
    host="database-2.ct2imowo41nh.ap-south-1.rds.amazonaws.com",
    port="5432"
)
cursor = pg_conn.cursor()

# Iterate over MongoDB documents and insert them into PostgreSQL
for doc in mongo_collection.find():
    # Remove ObjectId field from the document
    doc.pop('_id', None)
    print(doc)

    # Check if 'districtcode' key exists in the document
    if 'Districtcode' not in doc:
        print("Skipping document without 'districtcode'")
        continue

    Districtcode = doc['Districtcode']

    # Check if a record with the same Districtcode already exists in PostgreSQL
    cursor.execute(f"SELECT COUNT(*) FROM {table_name} WHERE Districtcode = %s", (Districtcode,))
    if cursor.fetchone()[0] > 0:
        print(f"Skipping duplicate record with Districtcode: {Districtcode}")
        continue

    # Quote column names that contain forward slashes
    quoted_columns = [f'"{col}"' if '/' in col else col for col in doc.keys()]
    columns = ', '.join(quoted_columns)
    placeholders = ', '.join(['%s'] * len(doc))
    print(placeholders)
    # Construct and execute the INSERT statement
    insert_statement = f"INSERT INTO {table_name} ({columns}) VALUES ({placeholders})"
    values = list(doc.values())
    print(values)
    cursor.execute(insert_statement, values)

# Commit changes and close connections
pg_conn.commit()
cursor.close()
pg_conn.close()
mongo_client.close()

